import React, { useState, useEffect } from "react";
import axios from "axios";

const Flights = () => {
  const [flights, setFlights] = useState([]);

  useEffect(() => {
    const fetchFlights = async () => {
      const options = {
        method: "GET",
        url: "https://sky-scrapper.p.rapidapi.com/api/v2/flights/searchFlights",
        params: {
          originSkyId: "LOND",
          destinationSkyId: "NYCA",
          originEntityId: "27544008",
          destinationEntityId: "27537542",
          date: "<REQUIRED>",
          adults: "1",
          currency: "USD",
          market: "en-US",
          countryCode: "US",
        },
        headers: {
          "X-RapidAPI-Key":
            "c02a254091mshc3cc59b3f13086ap1d42e2jsnbec0430ec97b",
          "X-RapidAPI-Host": "sky-scrapper.p.rapidapi.com",
        },
      };

      try {
        const response = await axios.request(options);
        setFlights(response.data); // assuming response.data contains flight information
      } catch (error) {
        console.error(error);
      }
    };

    fetchFlights();
  }, []); // Empty dependency array means this effect will only run once, equivalent to componentDidMount

  return (
    <div>
      <h2>Available Flights</h2>
      <ul>
        {flights.map((flight, index) => (
          <li key={index}>
            {/* Render flight information here */}
            Flight {index + 1}: {flight.name}, {flight.price}, etc.
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Flights;
